import "./App.css";
import React from "react";
import { Routes, Route } from 'react-router-dom';

import Home from "./pages";
import SignInPage from "./pages/signin";

function App() {
  return (
    <Router>
      <Routes>
  <Route path='/' element={<Home />} />
  <Route path='/signin' element={<SigninPage />} />
</Routes>
    </Router>
  );
}

export default App;
